import React from "react";

const nodejs_img = () => (
  <div>
    <i class="devicon-nodejs-plain" />
  </div>
);

const nodejs = {
  title: "Nodejs",
  icon: nodejs_img,
  svg_icon: null,
  value: "70"
};

export default nodejs;
